就職活動の必需品、リクルートスーツ。ジャケット・スカートの２点セットです。スカートの長さは、48丈と55丈からお好みの方を選べます。ご家庭の洗濯機で洗えるので、いつでも清潔な状態でご着用いただけます。消臭＆抗菌機能のあるデオドランテープ付きで、汗のニオイをシャットアウト。ジャケットは半裏地仕様。通気性が良く、もたつくことなくサラッと羽織っていただけます。シワにもなりにくい為、常に見た目のキレイさを保ちます。面接など、大切なシーンにもってこいの一着。説明会から面接までオールシーズン着回せるリクルートスーツです。


